Last weekend , Winter Throwdown was everything I had heard. “a killer freaking Time !!!” 
@corytexter and his @corytexterpromos crew did a outstanding job with a solid program and keeping the track conditions legit with god knows how many riders. Everyone was there !!!, tons of pros , tons of the top amateurs , and some very fast Hooligan riders.
Managed to pull of P7 Friday & P10 Saturday out of 35 Hooligan entries. 
🏁
📸 @mariahlacycreative with the crispness

Thank you big time too these fine folks that keep me going…
