@limahalfmile was a doozy last weekend!!! Struggle and comfortable is a understatement, but I did it and learn a lot. Most importantly I learned don’t take racing flattrack for granted. It’s a sport that needs full mental attention, commitment and preparation both physical and bike or your ass will get handed to you. I know what I’m capable of damnit !!!! I will be back if the opportunity comes with a entire different mindset. Thank you to @americanflattrack @robbybobby6nine @gnhc_racing for giving us a opportunity of a life time.  Thank you to @mariahlacycreative @deroot34 @theshopdayton @johnnybova35 for the photos. 

Shoutout to those that keep me safe and the bike running 

